import './Main.css';
import React, { useState, useEffect } from 'react';
import NoteForm from '../notes/NoteForm';
import NoteList from '../notes/NotesList';
import NewNoteButton from '../notes/NewNoteButton';
import NoteButtons from '../notes/NoteButtons';

function Main() {

  const [showButtons, setShowButtons] = useState(false);
  const [updateButtons, setUpdateButtons] = useState(false);
  const [showFields, setShowFields] = useState(false);
  const [notes, setNotes] = useState([]);
  const [noteTitle, setNoteTitle] = useState('');
  const [noteContent, setNoteContent] = useState('');
  const [selectedNote, setSelectedNote] = useState();

  // Fetch to-dos on component mount
  useEffect(() => {
    fetch('http://localhost:8080/todos')
      .then(response => {
        console.log('Fetch response:', response); // Log the raw response
        return response.json();
      })
      .then(data => {
        console.log('Data:', data); // Log the parsed data
        setNotes(data);  // Ensure this is an array of notes
      })
      .catch(error => {
        console.error('There was an error fetching the todos!', error);
      });
  }, []);
  

  const handleNewNoteBtn = () => {
    setNoteContent('');
    setNoteTitle('');
    setShowButtons(true);
    setUpdateButtons(false); 
    setShowFields(true); 
  };

  const handleDeleteBtnNew = () => {
    setShowButtons(false);
    setShowFields(false);
  };

  const handleAddBtn = () => {
    const newNote = {
      title: noteTitle,
      content: noteContent,
    };

    fetch('http://localhost:8080/todos', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(newNote),
    })
    .then(response => response.json())
    .then(data => {
      setNotes([...notes, data]);  // Add the new note to the state
    })
    .catch(error => {
      console.error('There was an error adding the note!', error);
    });

    setShowButtons(!showButtons);
    setShowFields(!showFields);
  };

  const openNote = (note) => {
    setShowButtons(false);
    setShowFields(true);
    setSelectedNote(note);

    setNoteTitle(note.title);
    setNoteContent(note.content);
    setUpdateButtons(!updateButtons);
  };

  const handleDeleteBtnUpdate = () => {
    fetch(`http://localhost:8080/todos/${selectedNote.id}`, {
      method: 'DELETE',
    })
    .then(() => {
      const remainingNotes = notes.filter(note => note.id !== selectedNote.id);
      setNotes(remainingNotes);  // Update the state after deleting the note
    })
    .catch(error => {
      console.error('There was an error deleting the note!', error);
    });

    setUpdateButtons(!updateButtons);
    setShowFields(!showFields);
  };

  const handleUpdateButton = () => {
    const updatedNote = {
      ...selectedNote,
      title: noteTitle,
      content: noteContent,
    };

    fetch(`http://localhost:8080/todos/${selectedNote.id}`, {
      method: 'PUT',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(updatedNote),
    })
    .then(response => response.json())
    .then(data => {
      const updatedNotes = notes.map(note =>
        note.id === selectedNote.id ? data : note
      );
      setNotes(updatedNotes);  // Update the state with the updated note
    })
    .catch(error => {
      console.error('There was an error updating the note!', error);
    });

    setNoteTitle('');
    setNoteContent('');
    setSelectedNote(null);
    setUpdateButtons(false);
    setShowFields(false);
  };

  const handleTitle = (e) => {
    setNoteTitle(e.target.value);
  };

  const handleContent = (e) => {
    setNoteContent(e.target.value);
  };

  return (
    <div id='mainBody'>
      <div id="notesSideBar">
        <NewNoteButton onClick={handleNewNoteBtn} />
        {showFields && (
          <NoteForm
            title={noteTitle}
            content={noteContent}
            onTitleChange={handleTitle}
            onContentChange={handleContent}
          />
        )}
        <NoteButtons
          onAdd={handleAddBtn}
          onDeleteNew={handleDeleteBtnNew}
          onUpdate={handleUpdateButton}
          onDeleteUpdate={handleDeleteBtnUpdate}
          showAdd={showButtons}
          showUpdate={updateButtons}
        />
      </div>
      <div id="notesDashboard">
        <h1 id="notedHeader"> TO DO </h1>
        <NoteList notes={notes} onSelect={openNote} />
      </div>
    </div>
  );
}

export default Main;
